script: |
  super -f text -I q4507.spq | sort > q4507.out

inputs:
  - name: q4507.spq
    data: |
      SELECT 19 AS col0, + 34 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE - col1 NOT BETWEEN col0 AND NULL;
  - name: tab1

outputs:
  - name: q4507.out
    data: |
      19	34
      19	34
      19	34
